import React from 'react'
import { withStyles } from "@material-ui/core/styles";
import { Button, TextField } from "@material-ui/core";

const Email = () => {
    const InputField = withStyles({
        root: {
          '& label.Mui-focused': {
            color: '#7C3AED',
          },
          '& .MuiOutlinedInput-root': {

            '& .MuiOutlinedInput-input':{
              color: 'white',
            },
            '& fieldset': {
              borderColor: '#9CA3AF',
            },
            '&:hover fieldset': {
              borderColor: 'white',
            },
            '&.Mui-focused fieldset': {
              borderColor: '#7C3AED',
            },

          },
          '& .MuiInputLabel-root': {
            color: 'white'
          }

        },
      })(TextField);

    return (
        <div class="mx-auto p-5 grid sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-2">
            <div class="flex-none">
                <div class="w-96 mt-5">
                <InputField label="Email Subject" variant="outlined"></InputField>
                </div>

            </div>
            <div class="flex-none">

            </div>
        </div>
    )
}

export default Email
